const styles = {
    button: {
      backgroundColor: '#ff007f',
      height: 50,
      flexDirection: 'row',
      borderRadius: 50,
      overflow: 'hidden',
      alignItems: 'center',
      marginTop: 8,
      maxWidth: 260,
      marginLeft: 'auto',
      marginRight: 'auto'
    },
  
    buttonText: {
      flex: 1,
      justifyContent: 'center',
      textAlign: 'center',
      color: '#FFF',
      fontFamily: 'Roboto_500Medium',
      fontSize: 16,
    },
  
    container: {
      flex: 1,
      backgroundColor: '#F0F0F5',
      alignItems: 'center',
      paddingTop: 20
    },
  
    editor: {
      alignSelf: 'flex-end',
      marginRight: 20
    },
  
    imageContainer: {
      alignItems: 'center',
      marginBottom: 20
    },
  
    image: {
      borderWidth: 2,
      borderColor: 'black',
      borderRadius: 100,
      width: 120,
      height: 120,
      overflow: 'hidden',
    },
  
    input: {
      backgroundColor: "white",
      borderRadius: 25,
      maxWidth: 350,
      padding: 8,
      marginTop: 0,
      marginBottom: 20,
    },
  
    inputDesc: {
      backgroundColor: '#fff',
      borderRadius: 25,
      maxWidth: 350,
      height: 120,
      paddingHorizontal: 10,
      paddingVertical: 10,
      marginTop: 0,
      marginBottom: 70,
    },
  
    text: {
      marginLeft: 14,
      fontSize: 20
    },
  
    title: {
      color: '#322153',
      fontSize: 20,
      fontFamily: 'Ubuntu_700Bold',
      maxWidth: 260,
      marginTop: 10
    },
  
    view: {
      width: '80%'
    },
  };
  
  export default styles;
